import React, {useEffect} from 'react';
import ReactGA from 'react-ga';
import Footer from "./components/Footer.js";
import CustomLogo from "./images/Logo261121.png";
import Santeros from "./pages/Santeros.js";
import Music from "./pages/Music.js";
import Texts from "./pages/Texts.js";
import Services from "./pages/Services.js";
import NotFound from "./pages/NotFound.js"
import MusicPage from "./pages/MusicPage.js";
import SocialMedia from "./components/SocialMedia.js"
import {Col, Row} from "react-bootstrap"
import {
      HashRouter, Switch, Route, Link
  } from 'react-router-dom';
import "./index.css"

function App() {
useEffect(() => {
  ReactGA.initialize('UA-211790415-1');
  ReactGA.pageview(window.location.pathname + window.location.search);
},[])

return (
    <HashRouter>
    <Row className="header">
    <Col className="display_inline" xs={12} s={6}>
      <SocialMedia />
    </Col>
    <Col className="display_inline"xs={12} s={6}>
    <img className="custom-logo" src={CustomLogo} alt="Custom Logo"></img>

    </Col>
    <Col className="display_inline" xs={12} s={6}>
      <nav className="menu">
          <ul className="menu">
            <li className="menu_link"><Link className="menu_link" to=
              "/bio">Bio</Link></li>
            <li className="menu_link"><Link className="menu_link" to=
            "/music">Music</Link></li>
         </ul>
          </nav>
    </Col>
    </Row>
      <Switch>
    <Route path="/bio" exact>
      <Santeros />
    </Route>
    <Route path="/404" component={NotFound} />
    <Route path="/music/:id" render={props => <MusicPage {...props}/>} />
    <Route path="/music" exact>
      <Music />
    </Route>
    <Route path="/texts" exact>
      <Texts />
    </Route>
    <Route path="/services" exact>
      <Services />
    </Route>
    </Switch>
      <Footer a id="f"/>
    </HashRouter>
  );
}

export default App;
